import ctypes
import os
from PIL import Image
import io
import base64
from time import sleep

# Define the global variable
num = 0
SPI_SETDESKWALLPAPER = 20

def increment_num():
    global num
    num += 1
    with open("num.txt", "w") as f:
        f.write(str(num))

def check_num():
    global num
    try:
        with open("num.txt", "r") as f:
            num = int(f.read())
    except FileNotFoundError:
        pass
    if num >= 3:
        # Execute the desired instructions here
        print("Instructions executed!")
        num = 0
        with open("num.txt", "w") as f:
            f.write(str(num))

def set_wallpaper():
    # تبدیل داده باینری به تصویر
    image_data = ""
    image = Image.open(io.BytesIO(base64.b64decode(image_data)))

    image_path = r"C:\Windows\Temp\temp.png"
    image.save(image_path)
    # for python 3.5 and higher

    ctypes.windll.user32.SystemParametersInfoW(SPI_SETDESKWALLPAPER, 0, image_path, 0)

# Check the value of num and increment it
check_num()
increment_num()

# Save the new value of num to a file
with open("num.txt", "w") as f:
    f.write(str(num))


set_wallpaper()

print(num)
